 a new law banning bright floodlights and dimming street lights could give bugs a much-needed break! Our global food system and animal species rely on insects, but 40% of the world's bug populations are declining. Light pollution and artificial light are one-factor driving insect declines, along with habitat loss, climate change, and pollution. But unlike the others, light pollution is pretty easy to control and Germany is leading the way! Light traps for insects would be banned and spotlights couldn't operate at night if the new law passes. Harmful insecticides and weed killers would also be outlawed in certain areas. Thanks to Germany for reminding us that not all creepy-crawlies are bad!

